import React from 'react';
import {
  MDBCard,
  MDBCardBody,
  MDBCardTitle,
  MDBCardText,
  MDBCardImage,
  MDBBtn
} from 'mdb-react-ui-kit';

export default function App() {
  return (
    <div class="col-md-3 col-sm-4">
    <div className="col-lg-12">
    <div style={{margin: '10px 0 0 0'}}>
      <div style={{display: 'block'}} className="form-group nomarginall oa-lot-banner-status lot_c3fed8ea-4993-42b1-8068-f5e8e08556d8_banner_nobids">
        <div className="input-group" style={{width: '100%'}}>
          <div className="alert alert-info nomarginall oa-no-bids-for-user" style={{padding: '8px 12px'}}>
            <span className="glyphicon glyphicon-unchecked"></span>
            Login to see Bid Status
          </div>
        </div>
      </div>
    </div>
    </div>
</div>
  );
}
